import React from "react";
import "./Adminpopuptitle.css";
import {MdClose} from "react-icons/md";

export default function Adminpopuptitle() {
  return (
    <>
      <div className="adminpopuptitle">
        <label>Filter Products</label>
        <MdClose/>
      </div>
    </>
  );
}
